import React from 'react';
import { useSelector } from 'react-redux';
import { Typography, Box, Paper } from '@mui/material';

const BatteryDetailsPanel = () => {
    const battery = useSelector((state:any) => state.battery);
    return (
        <>
        {"Battery Details Panel:- "}
        {"Battery Type:- "+ battery.batteryType}
        {"Battery Type:- "+ battery.batteryFloorHeight + "FT X "+ battery.batteryFloorHeight + "FT "}
        {"Battery Type:- "+ battery.batteryCost}
        <Box m={2}>
      <Paper elevation={3} variant="outlined">
        <Box p={2}>
          <Typography variant="h6" gutterBottom>
          {"Battery Type:- "+ battery.batteryType}
          </Typography>
          <Typography variant="body1">
            <td>
                <tr>
                    <td>{"Floor Dimension"}</td>
                    <td>{battery.batteryFloorWidth + "FT X " + battery.batteryFloorHeight + "FT"}</td>
                </tr>
                <tr>
                    <td>{"Energy"}</td>
                    <td>{battery.batteryEnergy}</td>
                </tr>
                <tr>
                    <td>{"Cost"}</td>
                    <td>{battery.batteryCost}</td>
                </tr>
                <tr>
                    <td>{"Release Date"}</td>
                    <td>{battery.batteryReleaseDate}</td>
                </tr>
            </td>
          </Typography>
          {/* Add more Typography components or other content as needed */}
        </Box>
      </Paper>
    </Box>
        </>
    );
}

export default BatteryDetailsPanel;
